import { View, Text, StyleSheet, ScrollView, ImageBackground, TouchableOpacity } from "react-native"
import { SafeAreaView } from "react-native-safe-area-context"
import { Bell, ChevronRight } from "../components/icons"
import { theme } from "../styles/theme"
import DailyMission from "../components/DailyMission"
import DiaryCard from "../components/DiaryCard"
import { useNavigation } from "@react-navigation/native"

const HomeScreen = () => {
  const navigation = useNavigation()

  // Sample data
  const missions = [
    {
      id: 1,
      title: "오늘의 추천 미션",
      description: "창문 밖 풍경을 5분간 바라보며 깊게 호흡하기",
      difficulty: "쉬움",
      category: "마음챙김",
    },
    {
      id: 2,
      title: "감정 표현하기",
      description: "오늘 느낀 감정을 3가지 단어로 표현해보기",
      difficulty: "보통",
      category: "감정인식",
    },
  ]

  const diaries = [
    {
      id: 1,
      date: "04.25",
      image: require("../../assets/images/window-view.png"),
      content:
        "오늘은 눈을 뜨는 것조차 힘들었다. 무언가 해야 할 일이 분명히 있었던 것 같은데, 머릿속은 안개처럼 뿌옇고, 손끝 하나 움직이는 싫었다.",
      likes: 5,
      comments: 2,
    },
    {
      id: 2,
      date: "04.24",
      image: require("../../assets/images/window-view-2.png"),
      content:
        "카페 창밖으로 노을이 지는 모습을 바라보며 오랜만에 마음의 여유를 느꼈다. 따뜻한 차 한잔과 함께하는 시간이 소중하게 느껴졌다.",
      likes: 12,
      comments: 4,
    },
  ]

  return (
    <SafeAreaView style={styles.container} edges={["top"]}>
      <ScrollView showsVerticalScrollIndicator={false}>
        {/* Header with night window image */}
        <View style={styles.headerContainer}>
          <ImageBackground
            source={require("../../assets/images/night-window.jpg")}
            style={styles.headerImage}
            resizeMode="cover"
          >
            <View style={styles.headerContent}>
              <Text style={styles.headerTitle}>Dearie</Text>
              <TouchableOpacity style={styles.bellButton}>
                <Bell color="#FFFFFF" size={20} />
              </TouchableOpacity>
            </View>

            {/* Greeting text with gradient overlay */}
            <View style={styles.greetingContainer}>
              <View style={styles.greetingGradient} />
              <View style={styles.greetingContent}>
                <Text style={styles.greetingTitle}>안녕하세요,</Text>
                <Text style={styles.greetingSubtitle}>오늘 하루는 어떠셨나요?</Text>
              </View>
            </View>
          </ImageBackground>
        </View>

        {/* Daily Missions Section */}
        <View style={styles.sectionContainer}>
          <View style={styles.sectionHeader}>
            <Text style={styles.sectionTitle}>오늘의 미션</Text>
            <TouchableOpacity style={styles.seeMoreButton} onPress={() => navigation.navigate("Mission" as never)}>
              <Text style={styles.seeMoreText}>더보기</Text>
              <ChevronRight color={theme.colors.gray[500]} size={16} />
            </TouchableOpacity>
          </View>

          <View style={styles.missionList}>
            {missions.map((mission) => (
              <DailyMission key={mission.id} mission={mission} />
            ))}
          </View>
        </View>

        {/* Recent Diaries Section */}
        <View style={[styles.sectionContainer, styles.lastSection]}>
          <View style={styles.sectionHeader}>
            <Text style={styles.sectionTitle}>최근 일기</Text>
            <TouchableOpacity style={styles.seeMoreButton} onPress={() => navigation.navigate("Diary" as never)}>
              <Text style={styles.seeMoreText}>더보기</Text>
              <ChevronRight color={theme.colors.gray[500]} size={16} />
            </TouchableOpacity>
          </View>

          <View style={styles.diaryList}>
            {diaries.map((diary) => (
              <DiaryCard key={diary.id} diary={diary} />
            ))}
          </View>
        </View>
      </ScrollView>
    </SafeAreaView>
  )
}

const styles = StyleSheet.create({
  container: {
    flex: 1,
    backgroundColor: "#FFFFFF",
  },
  headerContainer: {
    height: 380,
  },
  headerImage: {
    width: "100%",
    height: "100%",
  },
  headerContent: {
    flexDirection: "row",
    justifyContent: "space-between",
    alignItems: "center",
    padding: 16,
    paddingTop: 20,
  },
  headerTitle: {
    fontSize: 24,
    fontWeight: "bold",
    color: "#FFFFFF",
    textShadowColor: "rgba(0, 0, 0, 0.5)",
    textShadowOffset: { width: 1, height: 1 },
    textShadowRadius: 3,
  },
  bellButton: {
    width: 40,
    height: 40,
    borderRadius: 20,
    backgroundColor: "rgba(255, 255, 255, 0.1)",
    justifyContent: "center",
    alignItems: "center",
    borderWidth: 1,
    borderColor: "rgba(255, 255, 255, 0.2)",
  },
  greetingContainer: {
    position: "absolute",
    bottom: 0,
    left: 0,
    right: 0,
  },
  greetingGradient: {
    position: "absolute",
    bottom: 0,
    left: 0,
    right: 0,
    height: 160,
    backgroundColor: "rgba(255, 255, 255, 0)",
    borderTopColor: "rgba(255, 255, 255, 0.5)",
    borderTopWidth: 1,
  },
  greetingContent: {
    padding: 24,
    paddingTop: 80,
  },
  greetingTitle: {
    fontSize: 28,
    fontWeight: "bold",
    color: "#1F2937",
  },
  greetingSubtitle: {
    fontSize: 22,
    color: "#4B5563",
    marginTop: 4,
  },
  sectionContainer: {
    padding: 24,
  },
  lastSection: {
    paddingBottom: 100, // Extra padding for tab bar
  },
  sectionHeader: {
    flexDirection: "row",
    justifyContent: "space-between",
    alignItems: "center",
    marginBottom: 16,
  },
  sectionTitle: {
    fontSize: 20,
    fontWeight: "bold",
    color: "#1F2937",
  },
  seeMoreButton: {
    flexDirection: "row",
    alignItems: "center",
  },
  seeMoreText: {
    fontSize: 14,
    color: theme.colors.gray[500],
    marginRight: 4,
  },
  missionList: {
    gap: 12,
  },
  diaryList: {
    gap: 24,
  },
})

export default HomeScreen
